  false,\n\t\"url\": null,\n\t\"notes\": \"This newspaper article summarizes ongoing
  conservation and management of blowout penstemon on federal land.  The occurrence
  of this unique plant has never been extensive, and because the long-term future
  of this iconic Nebraska Sand Hills' species is uncertain, the U.S. Fish and Wildlife
  Service maintained its status as endangered early in June, 2012.  Blowout penstemon
  management on the following lands is provided: Nebraska National Forest and Grasslands,
  Crescent Lake National Wildlife Refuge, Valentine National Wildlife Refuge, and
  Graves Ranch.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
